r\">Novo na loja</h2>\n<!-- /wp:heading -->\n\n<!-- wp:woocommerce/product-new {\"columns\":4,\"rows\":1} /--></div>\n<!-- /wp:woocommerce/empty-cart-block --></div>\n<!-- /wp:woocommerce/cart -->', 'Carrinho', '', 'publish', 'closed', 'closed', '', 'carrinho', '', '', '2025-04-14 16:29:55', '2025-04-14 19:29:55', '', 0, 'http://localhost:8000/?page_id=6', 0, 'page', '', 0),
